import { jsPDF } from 'jspdf';

export const FONT_BLISSPRO_NORMAL =
  '';

const callAddFont = function (this: jsPDF) {
  this.addFileToVFS('BlissPro-normal.ttf', FONT_BLISSPRO_NORMAL);
  this.addFont('BlissPro-normal.ttf', 'BlissPro', 'normal');
};
jsPDF.API.events.push(['addFonts', callAddFont]);
